import { Row, Col } from "react-bootstrap";
import { useContext } from "react";
import { ModeContext } from "./ModeContext";

function OldNew() {
  const [show, setShow, language, setLanguage, mobile] = useContext(ModeContext);
  const sty = { height: mobile.oldnew };
  const img = mobile.arrow;
  return (
    <div className="OldNew" style={sty}>
      <Row>
        <Col xs={12} md={5}>
          <br />
          <center><u><h2 style={{ color: 'white' }}>{language.oldnew.befor}</h2></u>
            <hr style={{ color: 'white', width: '100px', height: '2px' }} />
          </center>
          <center><img src="../img/before.jpg" className="OldNewImg1" /></center>
        </Col>
        <Col xs={12} md={2}>
          <br /><br /><br /><br /><br /><br />
          <center><img src={img} className="OldNewImg3" /></center>
        </Col>
        <Col xs={12} md={5}>
          <br />
          <center><u><h2 style={{ color: 'white' }}>{language.oldnew.after}</h2></u>
            <hr style={{ color: 'white', width: '100px', height: '2px' }} />
          </center>
          <center><img src="../img/after.jpg" className="OldNewImg2" /></center>
        </Col>
      </Row>
    </div>
  );
}
export default OldNew;
